import { motion } from 'framer-motion';
import Link from 'next/link';

const projects = [
  {
    title: 'projet1',
    url: 'test',
  },
  {
    title: 'projet2',
    url: 'test',
  },
  {
    title: 'projet3',
    url: 'test',
  },
];

const easing = [0.6, -0.05, 0.01, 0.99];

const fadeInUp = {
  initial: { y: '-100vh' },
  animate: {
    y: 0,
    transition: {
      duration: 0.5,
      ease: easing,
    },
  },
  exit: { y: '-100vh' },
};

const stagger = {
  animate: {
    transition: {
      staggerChildren: 1,
    },
  },
};

export default () => {
  return (
    <motion.div
      initial={{ opacity: 0, x: '-10vh' }}
      animate={{ opacity: 1, x: 0 }}
      exit={{ opacity: 0 }}
    >
      <div className="container text-center">
        <h1>PORTFOLIO</h1>
        <motion.div
          variants={{ fadeInUp }}
          className="project-container border"
        >
          <h2>Test</h2>
        </motion.div>
      </div>
    </motion.div>
  );
};
